import {
    createBrowserRouter,
    createRoutesFromElements,
    Route
} from "react-router-dom";
import Frontend from "./components/Frontend";
import Body, { loader as BodyLoader } from "./components/Frontend/Body";
import HealthCheck from "./components/HealthCheck";

const router = createBrowserRouter(
    createRoutesFromElements(
        <>
            <Route path="/hc/:file" element={ <HealthCheck /> } />
            <Route path="/" element={<Frontend />} >
                <Route index={true} element={<Body />} loader={ BodyLoader }/>
                <Route path="*" element={<Body />} loader={ BodyLoader }/>
            </Route>
        </>
    )
);

export default router;
